import React, { Component } from "react";
import "./css/Head.css";

export default class Head extends Component {
  render() {
    return (
      <div className="Head">
        <h2 className="Logo">CutPaste</h2>
        <h2 className="Contact">Contact</h2>
      </div>
    );
  }
}
